// export default List;

import React from "react";

const List = ({ items = [], toggle, remove, asyncRemove }) => (
  <ul>
    {items.map(({ title }) => (
      <li
        key={title}
        style={{ textDecoration: title === title ? "line-through" : "none" }}
      >
        <span onClick={() => toggle(title)}>{title}</span>
        <button onClick={() => remove(title)}>Usuń</button>
        <button onClick={() => asyncRemove(title)}>Usuń po 2s</button>
      </li>
    ))}
  </ul>
);

export default List;
